INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("チカ（クリスマス）", 3, 6, 46, 108401, "福原綾香", "O", "ヒューマン", 17, 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 0, "カルミナ", "人々を守るために歌う、唱喚士の少女", 163, "各種楽器");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("クルミ（クリスマス）", 9, 6, 40, 108501, "植田佳奈", "B", "ヒューマン", 12, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 0, "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", 150, "観劇、おままごと");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES ("アヤネ（クリスマス）", 10, 5, 38, 108601, "芹澤優", "B", "ヒューマン", 14, 9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 0, "サレンディア救護院", "ぷうきちといつも一緒！", 148, "屋内でできる遊び");
